import Navbar from './Navbar';
import Articles from './Articles';
const navigation = [
  { name: 'Accueil', href: '/' },
  { name: 'Emploi du temps', href: '#' },
  { name: 'Trombinoscope', href: '#' },
  { name: 'About', href: '/about' },
]

function About() {
  return (
    <div>
      <Navbar navigation={ navigation } />
      <Articles />

    </div>
  );
}

export default About;
